import {BrowserRouter, Switch, Route} from 'react-router-dom';
import './styles/App.css';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path='/' component={Home} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
